const initState = {
    authError: null
}

const authReducer = (state = initState,action) => {
    switch(action.type){
        case 'LOGIN_ERROR':
            alert('login error')
            return {
                ...state,
                authError: 'Login failed'
                
            }
        case 'LOGIN_SUCCESS':
            alert('login success');
            return{
                ...state,
                authError: null
            }
        default:
            return state;
    }
    // return state;
}

export default authReducer;
